// import { Component } from "react";

import "./card.styles.css";

const Card = ({ id, name, email }) => (
  <div className="card-container" key={id}>
    <img
      alt={`monster ${name}`}
      src={`https://robohash.org/${id}?set2&size=180x180`}
    ></img>
    <h2>{name}</h2>
    <p>{email}</p>
  </div>
);

export default Card;
